function searchVideo(){
    let query=document.getElementById('query').value;

 fetch(`https://youtube.googleapis.com/youtube/v3/search?q=${query}&type=video&key=AIzaSyAS7veN7kG7coSDzV3zXgd5nctWW6dZIew&maxResults=50`)
  .then((res)=>{
    return res.json()
  })
  .then((res)=>{
       console.log(res);
     append_video(res.items)
      
  })
}


 function append_video(item){
    let parent=document.getElementById('video');
    parent.innerHTML=null
 item.forEach((e)=>{
    // console.log(e);

let div=document.createElement('div');
div.innerHTML=`<iframe width="350" height="220" src="https://www.youtube.com/embed/${e.id.videoId}" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>`
parent.append(div);
 })
 }